class ExampleApp extends LitElement {
    constructor() {
        super(...arguments);
        this.title = 'My app';
        this.dashboards = ['foo'];
    }
    render() {
        this.getDashboards();
        return html `
      <ol>
        ${map(this.dashboards, (dash) => html `<li>${dash}</li>`)}
      </ol>
    `;
    }
    getDashboards() {
        const result = [];
        for (let i = 0; i < 100; i += 1) {
            result.push("Foo");
        }
        this.dashboards = result;
    }
}
